column8:
繊細な音質を実現する和紙スピーカー搭載
<br>リモコンワンタッチで目に有害とされるブルーライトを最大約50%カットできるブルーライトガード機能搭載
<br>リモコンワンタッチで外付けHDDに番組録画できるUSBハードディスク録画機能搭載(裏録可能)
<br>必要に応じて余分な電気代をカットできる省エネモード搭載
<br>お好みの明るさに調整できるバックライト調光可能
<br>DVD/ブルーレイプレーヤーに接続できるHDMI端子×2系統
<br>壁掛けVESA 100mm×100mm
<br>音量を大きく出せない場所や深夜でも活用できる字幕<br>表示機能
<br>便利なEPG電子番組表 1週間対応
